def f1_score_cal(originalPrediction, predicted):
        
    # Calculate confusion matrix
    conf_matrix = confusion_matrix(originalPrediction, predicted)
    tn, fp, fn, tp = conf_matrix.ravel()

    # Calculate metrics
    accuracy = accuracy_score(originalPrediction, predicted)
    precision = precision_score(originalPrediction, predicted)
    recall = recall_score(originalPrediction, predicted)
    f1 = f1_score(originalPrediction, predicted)

    # Calculate TPR and FPR
    tpr = tp / (tp + fn)
    fpr = fp / (fp + tn)

    # Print the results
    print(f'\n{datetime.datetime.now()} :: ------------------------------------------------------------------------------------------------')
    print(f"Confusion Matrix:\n{conf_matrix}")
    print(f"True Positive (TP): {tp}")
    print(f"False Positive (FP): {fp}")
    print(f"False Negative (FN): {fn}")
    print(f"True Negative (TN): {tn}")
    print(f"True Positive Rate (TPR): {tpr}")
    print(f"False Positive Rate (FPR): {fpr}")
    print(f"Accuracy: {accuracy}")
    print(f"Precision: {precision}")
    print(f"Recall: {recall}")
    print(f"F1-Score: {f1}")

    # Plotting
    labels = ['Precision', 'Recall', 'F1-Score']
    values = [precision, recall, f1]
    plt.figure(figsize = (8,6)) 

    plt.bar(labels, values, color=['blue', 'green', 'orange'])
    plt.ylim([0, 1])  # Set the y-axis limit between 0 and 1
    plt.title('Performance Metrics')
    plt.xlabel('Metrics')
    plt.ylabel('Values')
    plt.show()
    plt.savefig('Performance_Metrics_2.1.png')

    plt.figure(figsize=(8, 6))

    # Create confusion matrix
    sns.heatmap(conf_matrix, annot=True, fmt="d", cmap="Blues", xticklabels=[0, 1], yticklabels=[0, 1])


        # tn, fp, fn, tp
    # Labeling quadrants

    plt.text(0.5, 0.5, f'\n\n TN{tn}', ha='center', va='center', color='black', fontsize=12)
    plt.text(1.5, 0.5, f'\n\n FP{fp}', ha='center', va='center', color='black', fontsize=12)
    plt.text(0.5, 1.5, f'\n\n FN{fn}', ha='center', va='center', color='black', fontsize=12)
    plt.text(1.5, 1.5, f'\n\n TP {tp}', ha='center', va='center', color='black', fontsize=12)



    # Plot confusion matrix using seaborn
    plt.xlabel("Predicted")
    plt.ylabel("Actual")
    plt.title("Confusion Matrix")
    plt.savefig('Confusion_Matrix_2_1.png')


    plt.show()
    
